import React from 'react';
import { CardHolder } from './components/CardHolder';
import { Footer } from './components/Footer';
import { Header } from './components/Header';
import styles from './App.module.css';

const App: React.FC = () => {
  return (
    <div className={styles.body}>
      <Header />
      <CardHolder />
      <Footer />
    </div>
  );
};

export default App;
